intro:
VK mình 8x đời gần giữa là NVVP, đã có 1 baby và để đổi không khí, vk mình tuyển Swing từ 40t trở lên khu vực sài gòn, có thể lâu dài ...

Yêu cầu:

- Sạch sẽ, kín đáo. lịch sự;
- Là vợ chồng thật;
- Không xăm trổ;
- Hàng càng to càng tốt;

Chỉ tuyển swing từ 40t trở lên nha các bạn.

Cặp nào có nhu cầu vui lòng inbox.
